import React from "react";
import {ReactComponent as Logo} from "./pill.svg";
import SvgIcon from "@material-ui/core/SvgIcon";

const PillIcon = () => (
    <SvgIcon>
        <Logo />
    </SvgIcon>
);

export default PillIcon;
